import React from "react";

function Card(props){
    console.log(props);
    return( 
  <>
      <div className='card'>
<img src={props.imgsrc} alt="mypic" className="card_img_top" />
<div className="card_body">
  <h5 className="card_title">{props.title}</h5>
  <p className="card_text">{props.sname}</p>
  <a href={props.link} target='_blank' className="btn_primary">
            <button> Watch Now</button>
          </a>
</div>
</div>
    </>
    );
  }

  export default Card;
